import './Catalog.css';

import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faCartPlus } from '@fortawesome/free-solid-svg-icons';

import { Button, Col, Container, Row } from "react-bootstrap";

function Catalog(){

    const ArraysOfCatalog = [{
        id: 1,
        title: 'Товар #1'
    }];
    const ArraysOfCatalogOnMap = ArraysOfCatalog.map((ArrayOfCatalog) => 
    <Col key = {ArrayOfCatalog.id} lg = "4" md = "6" sm = "12">
        <div class = "card-header">
            <h4 className = "text-center">{ArrayOfCatalog.title}</h4>
        </div>

        <div class = "card-image">

        </div>

        <div>
            <div class = "buttons">
                <Button variant="dark">Купить сейчас </Button>
                <Button variant="dark">В корзину <FontAwesomeIcon icon={faCartPlus}/> </Button>
            </div>
        </div>
    </Col>
    )

    return(
        <Container>
            <Row>
                {ArraysOfCatalogOnMap}
            </Row>
        </Container>
    )
}

export default Catalog
